#include <Wire.h>
#include <LiquidCrystal_I2C.h>
// LCD config: 0x27 is the common I2C address. Use 0x3F if 0x27 doesn‚Äôt work.
LiquidCrystal_I2C lcd(0x27, 16, 2);
// IR Sensor Pins
const int L2 = A0;
const int L1 = A1;
const int C  = A2;
const int R1 = A3;
const int R2 = 12; // Using D12 for R2
// Motor Pins (connected to L298N)
const int IN1 = 8;
const int IN2 = 9;
const int IN3 = 10;
const int IN4 = 11;
void setup() {
  // LCD setup
  lcd.init();
  lcd.backlight();
  lcd.setCursor(0, 0);
  lcd.print("Line Follower");
  // IR sensors
  pinMode(L2, INPUT);
  pinMode(L1, INPUT);
  pinMode(C, INPUT);
  pinMode(R1, INPUT);
  pinMode(R2, INPUT);
  // Motor pins
  pinMode(IN1, OUTPUT);
  pinMode(IN2, OUTPUT);
  pinMode(IN3, OUTPUT);
  pinMode(IN4, OUTPUT);
}
void loop() {
  int l2 = digitalRead(L2);
  int l1 = digitalRead(L1);
  int c  = digitalRead(C);
  int r1 = digitalRead(R1);
  int r2 = digitalRead(R2);
  // Forward
  if (l1 == 1 && c == 0 && r1 == 1) {
    moveForward();
    showLCD("Moving Forward");
  }
  // Slight Left
  else if (l1 == 0 && c == 0) {
    slightLeft();
    showLCD("Slight Left");
  }
  // Sharp Left
  else if (l2 == 0) {
    turnLeft();
    showLCD("Sharp Left");
  }
  // Slight Right
  else if (r1 == 0 && c == 0) {
    slightRight();
    showLCD("Slight Right");
  }
  // Sharp Right
  else if (r2 == 0) {
    turnRight();
    showLCD("Sharp Right");
  }
  // Stop if no line detected
  else {
    stopMotors();
    showLCD("Stopped / Lost");
  }
}
// -------------------- Motor Control Functions --------------------
void moveForward() {
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void slightLeft() {
  digitalWrite(IN1, LOW);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void slightRight() {
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, LOW);
  digitalWrite(IN4, LOW);
}
void turnLeft() {
  digitalWrite(IN1, LOW);
  digitalWrite(IN2, HIGH);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void turnRight() {
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, LOW);
  digitalWrite(IN4, HIGH);
}
void stopMotors() {
  digitalWrite(IN1, LOW);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, LOW);
  digitalWrite(IN4, LOW);
}
// -------------------- LCD Display Helper --------------------
void showLCD(String message) {
  lcd.clear();
  lcd.setCursor(0, 0);
  lcd.print(message);
}

