#include <Wire.h>
#include <LiquidCrystal_I2C.h>
LiquidCrystal_I2C lcd(0x27, 16, 2);
// IR sensors (Digital pins)
const int ir1 = 2;  // Left
const int ir2 = 4;
const int ir3 = 7;  // Center
const int ir4 = 8;
const int ir5 = 12; // Right
// Motors
const int ENA = 11;
const int IN1 = 9;
const int IN2 = 10;
const int ENB = 3;
const int IN3 = 6;
const int IN4 = 5;
int speedL = 150;
int speedR = 150;
void setup() {
  lcd.init();
  lcd.backlight();
  lcd.setCursor(0,0);
  lcd.print("Line Follower");
  pinMode(ir1, INPUT);
  pinMode(ir2, INPUT);
  pinMode(ir3, INPUT);
  pinMode(ir4, INPUT);
  pinMode(ir5, INPUT);
  pinMode(ENA, OUTPUT);
  pinMode(IN1, OUTPUT);
  pinMode(IN2, OUTPUT);
  pinMode(ENB, OUTPUT);
  pinMode(IN3, OUTPUT);
  pinMode(IN4, OUTPUT);
}
void loop() {
  int s1 = digitalRead(ir1);
  int s2 = digitalRead(ir2);
  int s3 = digitalRead(ir3);
  int s4 = digitalRead(ir4);
  int s5 = digitalRead(ir5);
  lcd.setCursor(0, 1);
  lcd.print("S:");
  lcd.print(s1);
  lcd.print(s2);
  lcd.print(s3);
  lcd.print(s4);
  lcd.print(s5);
  if (s3 == 0 && s2 == 1 && s4 == 1) {
    moveForward();
  }
  else if (s2 == 0 && s1 == 1) {
    turnLeft();
  }
  else if (s1 == 0) {
    sharpLeft();
  }
  else if (s4 == 0 && s5 == 1) {
    turnRight();
  }
  else if (s5 == 0) {
    sharpRight();
  }
  else {
    stopMotors();
  }
  delay(100);
}
void moveForward() {
  analogWrite(ENA, speedL);
  analogWrite(ENB, speedR);
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void turnLeft() {
  analogWrite(ENA, speedL / 2);
  analogWrite(ENB, speedR);
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void sharpLeft() {
  analogWrite(ENA, speedL);
  analogWrite(ENB, speedR);
  digitalWrite(IN1, LOW);
  digitalWrite(IN2, HIGH);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void turnRight() {
  analogWrite(ENA, speedL);
  analogWrite(ENB, speedR / 2);
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, HIGH);
  digitalWrite(IN4, LOW);
}
void sharpRight() {
  analogWrite(ENA, speedL);
  analogWrite(ENB, speedR);
  digitalWrite(IN1, HIGH);
  digitalWrite(IN2, LOW);
  digitalWrite(IN3, LOW);
  digitalWrite(IN4, HIGH);
}
void stopMotors() {
  analogWrite(ENA, 0);
  analogWrite(ENB, 0);
}

